package ManishLokesh.Neptune.v2.payment;import javax.persistence.Entity;import javax.persistence.GeneratedValue;import javax.persistence.GenerationType;import javax.persistence.Id;@Entitypublic class PaymentMethods {    @Id    @GeneratedValue(strategy = GenerationType.AUTO)    private Long id;    private String icon;    private String name;    private String description;    private Boolean isAvailable;    @Override    public String toString() {        return "PaymentMethods{" +                "id=" + id +                ", icon='" + icon + '\'' +                ", name='" + name + '\'' +                ", description='" + description + '\'' +                ", isAvailable=" + isAvailable +                '}';    }    public Long getId() {        return id;    }    public void setId(Long id) {        this.id = id;    }    public String getIcon() {        return icon;    }    public void setIcon(String icon) {        this.icon = icon;    }    public String getName() {        return name;    }    public void setName(String methodName) {        this.name = methodName;    }    public String getDescription() {        return description;    }    public void setDescription(String description) {        this.description = description;    }    public Boolean getAvailable() {        return isAvailable;    }    public void setAvailable(Boolean available) {        isAvailable = available;    }}